function getAll() {
    return cards;
}

function getOne(id) {
    console.log(id);
    return cards.find((card) => card.id === id);
}

function create(card) {
    if (!card.image_uris) {
        card.layout = ' ';
        card.image_uris = { small: '', large: ''};
        card.image_uris.small = 'https://i.imgur.com/BCGSyyk.png';
        card.image_uris.large = 'https://i.imgur.com/D8TWkoK.png';
    }
    card.id = Date.now() % 1000000;
    card.id = card.id.toString();
    console.log(card);
    console.log(card.layout);
    cards.push(card);
}

function removeOne(id) {
    cards.splice(cards.findIndex((card) => card.id === id), 1);
}

function update(id, body) {
    const idx = cards.findIndex((card) => card.id === id);
    Object.keys(body).forEach((key) => {
        cards[idx][key] = body[key];
    });
}